import { request } from '../../axios_helper';
import { useState, useEffect } from 'react';
import jsPDF from 'jspdf';
import 'jspdf-autotable';

interface Transaction {
  username: string;
  id: number;
  livre_id: number;
  dateEmprunt: string;
  dateRetour: string;
  retourne: boolean;
  prixTotal: number;
}

const TableThree = () => {
  const [transactions, setTransactions] = useState<Transaction[]>([]);
  const [selectedTransactionId, setSelectedTransactionId] = useState<number | null>(null);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [selectedDate, setSelectedDate] = useState('');

  useEffect(() => {
    request('get', '/public/getTransactions')
      .then((response) => {
        setTransactions(response.data);
      })
      .catch((error) => {
        console.error('Error fetching transactions:', error);
      });
  }, []);

  const formatDate = (dateString: string): string => {
    const options: Intl.DateTimeFormatOptions = {
      month: 'short',
      day: '2-digit',
      year: 'numeric',
    };
    return new Date(dateString).toLocaleDateString('en-US', options);
  };

  const toggleModal = () => setIsModalOpen(!isModalOpen);

  const fetchTransactions = async () => {
    try {
      const response = await request('get', '/public/getTransactions'); 
      setTransactions(response.data); 
    } catch (error) {
      console.error('Error fetching transactions:', error);
    }
  };
  const handleConfirm = () => {

    request('post', '/admin/retour', {
      transactionId: selectedTransactionId, 
      dateRetourReel: selectedDate,
    })
      .then((response) => {
        
        console.log('Transaction confirmed:', response.data);
        setIsModalOpen(false);
        fetchTransactions();
      })
      .catch((error) => {
        console.error('Error confirming transaction:', error);
      });
  };

  const handleConfirmClick = (transactionId: number) => {
    setSelectedTransactionId(transactionId);
    toggleModal();
  };
  const deleteTransaction = async (transactionId: number) => {
    const isConfirmed = window.confirm('Are you sure you want to delete this transaction?');
  
    if (!isConfirmed) {
      return;
    }
    try {
      await request('delete', `/admin/transactions/${transactionId}`);
      console.log(`Transaction with ID ${transactionId} deleted successfully.`);
      fetchTransactions();
    } catch (error) {
      console.error('Error deleting transaction:', error);
    }
  };
 
const generatePDF = (transaction: Transaction) => {
  const doc = new jsPDF();

  const logoBase64 = 'data:image/png;base64,'; // Remplacez par votre image en base64
  const signatureBase64 = 'data:image/png;base64,';
  const cachetBase64 = 'data:image/png;base64,';
  doc.setFontSize(12);
  doc.text(`FACTURE : N° 0001`, 10, 10);

  doc.setFontSize(10);
  doc.text('Societe: Booklend', 10, 20);
  doc.text('Email: contact@booklend.com', 10, 30);
  doc.text('Adresse: 123 Book Street, Sfax', 10, 40);

  const logoWidth = 50;
  const logoHeight = 30;
  const pageWidth = doc.internal.pageSize.width;
  const logoX = pageWidth - logoWidth - 10;
  const logoY = 0;
  doc.addImage(logoBase64, 'PNG', logoX, logoY, logoWidth, logoHeight);
  
  doc.setFontSize(14);
  doc.text('Détails de la transaction', 10, 60);

  const tableX = 10;
  const tableY = 70; 

  (doc as any).autoTable({
    startY: tableY, 
    margin: { left: tableX },
    head: [['Field', 'Value']],
    body: [
      ['ID de la transaction', transaction.id.toString()],
      ['Client', transaction.username],
      ['ID du livre', transaction.livre_id.toString()],
      ['Date d\'emprunt', formatDate(transaction.dateEmprunt)],
      ['Date de retour', formatDate(transaction.dateRetour)],
      ['Statut', transaction.retourne ? 'Retourne' : 'En cours'],
      ['Prix', transaction.prixTotal.toString()+" DT"],
    ],
    theme: 'striped',
  });
  const today = new Date();
  const formattedDate = `${today.toLocaleDateString('fr-FR')}`; 
  doc.setFontSize(10);
  doc.text(`Date de génération : ${formattedDate}`, 10, doc.autoTable.previous.finalY + 15);
  doc.addImage(cachetBase64, 'PNG',pageWidth - logoWidth - 20 ,doc.autoTable.previous.finalY+20 ,50 , 30);
  doc.text('Signature de Gérant :',pageWidth - logoWidth - 10 , doc.autoTable.previous.finalY+15);
  doc.addImage(signatureBase64, 'PNG',pageWidth - logoWidth - 20 ,doc.autoTable.previous.finalY+20 ,50 , 30);
  doc.save(`invoice-${transaction.id}.pdf`);
};
  return (
    <div className="rounded-sm border  border-stroke bg-white px-5 pt-6 pb-2.5 shadow-default dark:border-strokedark dark:bg-boxdark sm:px-7.5 xl:pb-1">
      <div
        className={`max-w-full overflow-x-auto ${isModalOpen ? 'filter blur-sm' : ''} `}
      >
        <div className="py-2 pb-6 border-b  border-stroke dark:border-strokedark  px-4 md:px-6 xl:px-5.5">
          <h4 className="text-xl font-semibold text-black dark:text-white">
            Transactions
          </h4>
        </div>
        <table className="w-full table-auto">
          <thead>
            <tr className="bg-gray-2 text-left dark:bg-meta-4">
              <th className="min-w-[35px] py-4 px-4 font-medium text-black dark:text-white xl:pl-6">
                Transaction Id
              </th>
              <th className="min-w-[30px] py-4 px-4 font-medium text-black dark:text-white">
                User
              </th>

              <th className="min-w-[100px] py-4 px-4 font-medium text-black dark:text-white">
                Book Id
              </th>
              <th className="py-4 px-4 font-medium text-black dark:text-white">
                Borrowing Date
              </th>
              <th className="py-4 px-4 font-medium text-black dark:text-white">
                Return Date
              </th>
              <th className="py-4 px-4 font-medium text-black dark:text-white">
                Status
              </th>
              <th className="py-4 px-4 font-medium text-black dark:text-white">
                Price
              </th>
              <th className="py-4 px-4 font-medium text-black dark:text-white">
                Actions
              </th>
            </tr>
          </thead>
          <tbody>
            {transactions.map((transaction) => (
              <tr key={transaction.id}>
                <td className="border-b border-[#eee] py-5 px-4 pl-9 dark:border-strokedark xl:pl-10">
                  <h5 className="font-medium text-black dark:text-white">
                    {transaction.id}
                  </h5>
                </td>
                <td className="border-b border-[#eee] py-5 px-4 dark:border-strokedark">
                  <p className="text-black dark:text-white">
                    {transaction.username}
                  </p>
                </td>
                <td className="border-b border-[#eee] py-5 px-4 dark:border-strokedark">
                  <p className="inline-flex rounded-full bg-opacity-10 py-1 px-3 text-sm font-medium">
                    {transaction.livre_id}
                  </p>
                </td>
                <td className="border-b border-[#eee] py-5 px-4 dark:border-strokedark">
                  <p className="inline-flex rounded-full bg-opacity-10 py-1 px-3 text-sm font-medium">
                    {formatDate(transaction.dateEmprunt)}
                  </p>
                </td>
                <td className="border-b border-[#eee] py-5 px-4 dark:border-strokedark">
                  <p className="inline-flex rounded-full bg-opacity-10 py-1 px-3 text-sm font-medium">
                    {formatDate(transaction.dateRetour)}
                  </p>
                </td>
                <td className="border-b border-[#eee] py-5 px-4 dark:border-strokedark">
                  <p
                    className={`inline-flex rounded-full py-1 px-3 text-sm font-medium ${transaction.retourne ? 'bg-success bg-opacity-10 text-success' : 'bg-warning bg-opacity-10 text-warning'}`}
                  >
                    {transaction.retourne ? 'Returned' : 'Processing'}
                  </p>
                </td>
                <td className="border-b border-[#eee] py-5 px-4 dark:border-strokedark">
                  <p className="inline-flex rounded-full bg-opacity-10 py-1 px-3 text-sm font-medium">
                    {transaction.prixTotal}
                  </p>
                </td>

                <td className="border-b border-[#eee] py-5 px-4 dark:border-strokedark">
                  {transaction.retourne ? (
                    <div className="flex items-center space-x-4">
                      <button className="hover:text-primary"
                      >
                        <svg
                          className="fill-current"
                          width="18"
                          height="18"
                          viewBox="0 0 18 18"
                          fill="none"
                          xmlns="http://www.w3.org/2000/svg"
                        >
                          <path
                            d="M8.99981 14.8219C3.43106 14.8219 0.674805 9.50624 0.562305 9.28124C0.47793 9.11249 0.47793 8.88749 0.562305 8.71874C0.674805 8.49374 3.43106 3.20624 8.99981 3.20624C14.5686 3.20624 17.3248 8.49374 17.4373 8.71874C17.5217 8.88749 17.5217 9.11249 17.4373 9.28124C17.3248 9.50624 14.5686 14.8219 8.99981 14.8219ZM1.85605 8.99999C2.4748 10.0406 4.89356 13.5562 8.99981 13.5562C13.1061 13.5562 15.5248 10.0406 16.1436 8.99999C15.5248 7.95936 13.1061 4.44374 8.99981 4.44374C4.89356 4.44374 2.4748 7.95936 1.85605 8.99999Z"
                            fill=""
                          />
                          <path
                            d="M9 11.3906C7.67812 11.3906 6.60938 10.3219 6.60938 9C6.60938 7.67813 7.67812 6.60938 9 6.60938C10.3219 6.60938 11.3906 7.67813 11.3906 9C11.3906 10.3219 10.3219 11.3906 9 11.3906ZM9 7.875C8.38125 7.875 7.875 8.38125 7.875 9C7.875 9.61875 8.38125 10.125 9 10.125C9.61875 10.125 10.125 9.61875 10.125 9C10.125 8.38125 9.61875 7.875 9 7.875Z"
                            fill=""
                          />
                        </svg>
                      </button>
                      <button className="hover:text-primary"
                      onClick={() => deleteTransaction(transaction.id)}>
                        <svg
                          className="fill-current"
                          width="18"
                          height="18"
                          viewBox="0 0 18 18"
                          fill="none"
                          xmlns="http://www.w3.org/2000/svg"
                        >
                          <path
                            d="M13.7535 2.47502H11.5879V1.9969C11.5879 1.15315 10.9129 0.478149 10.0691 0.478149H7.90352C7.05977 0.478149 6.38477 1.15315 6.38477 1.9969V2.47502H4.21914C3.40352 2.47502 2.72852 3.15002 2.72852 3.96565V4.8094C2.72852 5.42815 3.09414 5.94065 3.61289 6.17877V16.2063C3.61289 17.0501 4.28789 17.7251 5.13164 17.7251H12.8408C13.6846 17.7251 14.3596 17.0501 14.3596 16.2063V6.17877C14.8785 5.94065 15.2441 5.42815 15.2441 4.8094V3.96565C15.2441 3.15002 14.5691 2.47502 13.7535 2.47502ZM7.40352 1.9969C7.40352 1.84565 7.52127 1.7279 7.67252 1.7279H9.83814C9.98939 1.7279 10.1071 1.84565 10.1071 1.9969V2.47502H7.40352V1.9969ZM13.3748 16.2063C13.3748 16.3575 13.2571 16.4753 13.1058 16.4753H5.39664C5.24539 16.4753 5.12764 16.3575 5.12764 16.2063V6.10377H13.3748V16.2063ZM14.0053 4.8094C14.0053 4.9614 13.8875 5.0794 13.7365 5.0794H4.23664C4.08539 5.0794 3.96764 4.9614 3.96764 4.8094V3.96565C3.96764 3.8144 4.08539 3.69665 4.23664 3.69665H13.7535C13.9048 3.69665 14.0225 3.8144 14.0225 3.96565V4.8094H14.0053Z"
                            fill=""
                          />
                          <path
                            d="M11.4938 6.98291C11.3426 6.98291 11.2249 7.10066 11.2249 7.25191V14.9567C11.2249 15.1079 11.3426 15.2257 11.4938 15.2257C11.6451 15.2257 11.7628 15.1079 11.7628 14.9567V7.25191C11.7628 7.10066 11.6451 6.98291 11.4938 6.98291Z"
                            fill=""
                          />
                          <path
                            d="M9 6.98291C8.84875 6.98291 8.731 7.10066 8.731 7.25191V14.9567C8.731 15.1079 8.84875 15.2257 9 15.2257C9.15125 15.2257 9.269 15.1079 9.269 14.9567V7.25191C9.269 7.10066 9.15125 6.98291 9 6.98291Z"
                            fill=""
                          />
                          <path
                            d="M6.50618 6.98291C6.35493 6.98291 6.23718 7.10066 6.23718 7.25191V14.9567C6.23718 15.1079 6.35493 15.2257 6.50618 15.2257C6.65743 15.2257 6.77518 15.1079 6.77518 14.9567V7.25191C6.77518 7.10066 6.65743 6.98291 6.50618 6.98291Z"
                            fill=""
                          />
                        </svg>
                      </button>
                      <button className="hover:text-primary"
                       onClick={() => generatePDF(transaction)}>
                        <svg
                          className="fill-current"
                          width="18"
                          height="18"
                          viewBox="0 0 18 18"
                          fill="none"
                          xmlns="http://www.w3.org/2000/svg"
                        >
                          <path
                            d="M16.8754 11.6719C16.5379 11.6719 16.2285 11.9531 16.2285 12.3187V14.8219C16.2285 15.075 16.0316 15.2719 15.7785 15.2719H2.22227C1.96914 15.2719 1.77227 15.075 1.77227 14.8219V12.3187C1.77227 11.9812 1.49102 11.6719 1.12539 11.6719C0.759766 11.6719 0.478516 11.9531 0.478516 12.3187V14.8219C0.478516 15.7781 1.23789 16.5375 2.19414 16.5375H15.7785C16.7348 16.5375 17.4941 15.7781 17.4941 14.8219V12.3187C17.5223 11.9531 17.2129 11.6719 16.8754 11.6719Z"
                            fill=""
                          />
                          <path
                            d="M8.55074 12.3469C8.66324 12.4594 8.83199 12.5156 9.00074 12.5156C9.16949 12.5156 9.31012 12.4594 9.45074 12.3469L13.4726 8.43752C13.7257 8.1844 13.7257 7.79065 13.5007 7.53752C13.2476 7.2844 12.8539 7.2844 12.6007 7.5094L9.64762 10.4063V2.1094C9.64762 1.7719 9.36637 1.46252 9.00074 1.46252C8.66324 1.46252 8.35387 1.74377 8.35387 2.1094V10.4063L5.40074 7.53752C5.14762 7.2844 4.75387 7.31252 4.50074 7.53752C4.24762 7.79065 4.27574 8.1844 4.50074 8.43752L8.55074 12.3469Z"
                            fill=""
                          />
                        </svg>
                      </button>
                    </div>
                  ) : (
                    <button
                      type="button"
                      onClick={() => handleConfirmClick(transaction.id)}
                      className="text-white bg-meta-3 hover:bg-success focus:outline-none focus:ring-4 focus:ring-green-300 font-medium rounded-full text-sm px-5 py-2.5 text-center me-2 mb-2 dark:bg-green-600 dark:hover:bg-green-700 dark:focus:ring-green-800"
                    >
                      Confirm
                    </button>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      {/* Main Modal */}
      {isModalOpen && (
        <div
          className="fixed inset-0 z-50 flex items-center justify-center overflow-auto bg-form-input bg-opacity-60"
          aria-hidden="true"
        >
          <div className="relative w-full max-w-md p-4 bg-white rounded-lg shadow dark:bg-gray-800 flex flex-col items-center">
            {/* Modal Content */}
            <button
              type="button"
              onClick={toggleModal}
              className="absolute top-2.5 right-2.5 text-gray-400 hover:bg-gray-200 hover:text-gray-900 rounded-lg text-sm p-1.5 dark:hover:bg-gray-600 dark:hover:text-white"
              aria-label="Close modal"
            >
              <svg
                aria-hidden="true"
                className="w-5 h-5"
                fill="currentColor"
                viewBox="0 0 20 20"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  fillRule="evenodd"
                  d="M4.293 4.293a1 1 0 011.414 0L10 8.586l4.293-4.293a1 1 0 111.414 1.414L11.414 10l4.293 4.293a1 1 0 01-1.414 1.414L10 11.414l-4.293 4.293a1 1 0 01-1.414-1.414L8.586 10 4.293 5.707a1 1 0 010-1.414z"
                  clipRule="evenodd"
                ></path>
              </svg>
            </button>
            <svg
              xmlns="http://www.w3.org/2000/svg"
              className="w-12 h-12 text-[#1E9B13] mb-4"
              viewBox="0 0 24 24"
              fill="none"
              stroke="currentColor"
              strokeWidth="3"
              strokeLinecap="round"
              strokeLinejoin="round"
            >
              <path d="M5 13l4 4L19 7" />
            </svg>
            <p className="mb-4 text-meta-4 text-base dark:text-form-strokedark text-center">
              Are you sure you want to confirm this transaction?
            </p>
            <input
              type="date"
              value={selectedDate}
              onChange={(e) => setSelectedDate(e.target.value)}
              className="block  mb-8 mt-2 px-2 py-1.5 w-5/6  border border-graydark rounded-md shadow-sm focus:ring-primary-500 focus:border-primary-500 dark:border-gray-600 dark:bg-gray-700 dark:text-gray-300"
            />
            <div className="flex justify-center items-center space-x-4">
              <button
                onClick={toggleModal}
                type="button"
                className="py-2.5 px-4 text-sm font-medium text-gray-500 bg-white rounded-lg border border-gray-200 hover:bg-gray-100 focus:ring-4 focus:outline-none focus:ring-primary-300 hover:text-gray-900 focus:z-10 dark:bg-gray-700 dark:text-gray-300 dark:border-gray-500 dark:hover:text-white dark:hover:bg-gray-600 dark:focus:ring-gray-600"
              >
                Cancel
              </button>
              <button
                onClick={handleConfirm}
                type="button"
                className="py-2.5 px-4 text-sm font-medium text-center text-white bg-[#000000] rounded-lg hover:bg-red-700 focus:ring-4 focus:outline-none focus:ring-red-300 dark:bg-red-500 dark:hover:bg-red-600 dark:focus:ring-red-900"
              >
                Confirm
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default TableThree;
